function maxValue(e,t,n,r){t++;var i=hasWinner(e);if(i!=null)return i==IA_PLAYER?Number.POSITIVE_INFINITY-1:Number.NEGATIVE_INFINITY+1;if(t>MAX_ITERATION)return utility(e,IA_PLAYER);var s=Number.NEGATIVE_INFINITY,o=getPossibleMovements(e,IA_PLAYER);for(var u=0;u<o.length;u++){s=Math.max(s,minValue(o[u].table,t,n,r));if(s>=r)return s;n=Math.max(n,s)}return s}function minValue(e,t,n,r){t++;var i=hasWinner(e);if(i!=null)return i==IA_PLAYER?Number.POSITIVE_INFINITY-1:Number.NEGATIVE_INFINITY+1;if(t>MAX_ITERATION)return utility(e,IA_PLAYER);var s=Number.POSITIVE_INFINITY,o=getPossibleMovements(e,HUMAN_PLAYER);for(var u=0;u<o.length;u++){s=Math.min(s,maxValue(o[u].table,t,n,r));if(s<=n)return s;r=Math.min(r,s)}return s}function minimaxDecision(e){var t=getPossibleMovements(e,IA_PLAYER),n=Number.NEGATIVE_INFINITY,r=null;for(var i=0;i<t.length;i++){var s=minValue(t[i].table,0,Number.NEGATIVE_INFINITY,Number.POSITIVE_INFINITY);if(s>n){n=s;r=i}}return t[r]}function utility(e,t){return utilityBalanced(e,t)}function utilityGreedy(e,t){var n=0,r=0;for(var i=0;i<e.length;i++)for(var s=0;s<e[0].length;s++)if(e[i][s]!=EMPTY_CELL&&e[i][s]!=t){e[i][s]>1&&(n+=4);n++}else if(e[i][s]==t){e[i][s]>1&&(r+=10);r++}return-n}function utilityBalanced(e,t){var n=0,r=0;for(var i=0;i<e.length;i++)for(var s=0;s<e[0].length;s++)if(e[i][s]!=EMPTY_CELL&&e[i][s]!=t){e[i][s]>1&&(n+=4);n++}else if(e[i][s]==t){e[i][s]>1&&(r+=10);r++}return r-n};